# 713. Subarray Product Less Than K
# Medium
# 4.9K
# 158
# Companies
# Given an array of integers nums and an integer k, return the number of contiguous subarrays where the product of all the elements in the subarray is strictly less than k.

# Example 1:
# Input: nums = [10,5,2,6], k = 100
# Output: 8
# Explanation: The 8 subarrays that have product less than 100 are:
# [10], [5], [2], [6], [10, 5], [5, 2], [2, 6], [5, 2, 6]
# Note that [10, 5, 2] is not included as the product of 100 is not strictly less than k.

def main(nums, k):
    counters = 0
    windows = []
    
    for nums_i in range(0, len(nums)):
        value = nums[nums_i]
        last_window_value = 1
        for windows_i in range(0, len(windows)):
            #print(nums_i, value, windows_i, windows)
            last_window_value = windows[windows_i]
            new_window_value = int(last_window_value * value / nums[nums_i-windows_i-1])
            if new_window_value < k:
                windows[windows_i] = new_window_value
                counters = counters + 1
                #print("c", windows, windows_i)
            else:
                # !!! decrease array
                windows = windows[0 : windows_i]
                #print("d", windows, windows_i, nums_i, new_window_value)
                break

        new_window_value = last_window_value * value
        if new_window_value < k:
            windows.append(new_window_value)
            counters = counters + 1
            #print("a", windows)

    return counters

